DROP TABLE IF EXISTS `t_bas_region`;
CREATE TABLE `t_bas_region` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT COMMENT '主键',
  `region_code` varchar(32) DEFAULT NULL COMMENT '行政编码',
  `region_name` varchar(128) DEFAULT NULL COMMENT '行政名称',
  `region_type` int(11) DEFAULT '-1' COMMENT '区域类型：country-0 、province-1、city-2、county-3、town-4、street-5',
  `brief_name` varchar(32) DEFAULT NULL COMMENT '简称',
  `available_name` varchar(128) DEFAULT NULL COMMENT '可用名称',
  `parent_code` varchar(32) DEFAULT NULL COMMENT '上级行政编码',
  `degree` varchar(32) DEFAULT NULL COMMENT '级别：country-国家 、province-省、city-市、county-县、town-乡镇、street-街道',
  `pinyin` varchar(64) DEFAULT NULL COMMENT '拼音',
  `descripion` varchar(256) DEFAULT NULL COMMENT '描述',
  `active` char(1) DEFAULT NULL COMMENT '状态：Y-可用、N-禁用',
  `create_date` datetime DEFAULT NULL COMMENT '创建时间',
  `create_user` varchar(64) DEFAULT NULL COMMENT '创建人',
  `modify_date` datetime DEFAULT NULL COMMENT '修改时间',
  `modify_user` varchar(64) DEFAULT NULL COMMENT '修改人',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=16885 DEFAULT CHARSET=utf8 ROW_FORMAT=COMPACT;

